/*
 * Page Configuration
 * you can customize general page configuration in the object below
 */

const PAGE = {
  loginPagePath: "/login",
  dashboardPagePath: "/",
  favicon: "/images/favicon.ico",
  layout: {
    enableHeader: true,
    enableFooter: true,
    enableScrolltop: true,
    enableFloatButton: true,
  }
}

export default PAGE
